import React from 'react';

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/contact">Contact Us</a></li>
        <li><a href="/service">Service</a></li>
        <li><a href="/portfolio">Portfolio</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
